class Fone:
    def __init__(self, id, number):
        self.id = id
        self.number = number

    def isValid(self):
        validos = "0123456789().-"
        for i in self.number:
            if i in validos:
                return True
            return False

    def __str__(self):
        return "{self.id}:{self.number}"

